import css from 'styled-jsx/css';

export default css`.solution-card {
  width: 301px;
  height: 219px;
  display: inline-block;
  background: #f8faff;
  margin-bottom: 22px;
  box-shadow: 0px 12px 23px 4px rgba(216, 223, 229, 0.3);
}
.solution-card .pic-wrap {
  width: 301px;
  height: 124px;
  overflow: hidden;
  border: 1px solid #eee;
}
.solution-card .pic-wrap img {
  width: 301px;
  height: 124px;
}
.solution-card p {
  height: 23px;
  font-size: 24px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #666666;
  margin-left: 51px;
  margin-top: 35px;
}
`
